import { NAME, ADD } from '/home/ksolves/Documents/sujeet/training/ReactJs/redux-app/src/action_type/index.js';

const update_name = () => {
  switch (NAME) {
    case NAME:
      return "sk";
    default:
      return null;
  }
}

const update_add = () => {
  switch (ADD) {
    case ADD:
      return "dl";
    default:
      return null;
  }
}

export {update_name,update_add};
